import Logo from "./Logo"
import { Link } from "react-router-dom"
export default function Header () {
    const styles = {
        nav: {
          backgroundColor: 'white',
          padding: '16px',
          boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)', // Optional: Add a slight shadow for a 3D effect
        },
        navList: {
          display: 'flex',
          listStyle: 'none',
          margin: 0,
          padding: 0,
        },
        navItem: {
          margin: '0 10px',
        },
        navLink: {
          color: 'black',
          textDecoration: 'none',
          padding: '8px 12px',
          borderRadius: '4px',
          transition: 'background-color 0.2s ease',
        },
        // Dark blue cover on hover
        navLink: {
          color: 'black',
          textDecoration: 'none',
          padding: '8px 12px',
          borderRadius: '4px',
          transition: 'background-color 0.2s ease',
        },
        'navLink:hover': {
          backgroundColor: "darkblue",
          color: "white",
        },
      };

    return (
        <header className="App-header">
            <Logo /> 
            <nav>
                <ul>
                    <li>
                    <Link to="/">Home</Link>
                    </li>
                    <li>
                    <Link to="/about-us">About Us</Link>
                    </li>
                    <li>
                    <Link to="/contact">Contact</Link>
                    </li>
                </ul>
            </nav>  
        </header>
    )
}
